import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import axios from 'axios';
import swal from 'sweetalert2';

const NewEventsForm = () => {
  const [eventData, setEventData] = useState({
    label: '',
    dateFrom: '',
    dateTo: '',
    description: '',
    repeat: false,
    priority: '',
    // Add more properties for each event as needed
  });

  const handleInputChange = (event) => {
    const { name, value, type, checked } = event.target;
    const newValue = type === 'checkbox' ? checked : value;
    setEventData({ ...eventData, [name]: newValue });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Assuming you have your backend route for creating events at '/api/events'
    axios
      .post('http://localhost:5000/event/api/events', eventData)
      .then((response) => {
        console.log(response.data);
        // Show success message
        swal.fire({
          title: 'Data submitted',
          icon: 'success',
          confirmButtonText: 'OK',
        });
        // Reset the form after successful submission
        setEventData({
          label: '',
          dateFrom: '',
          dateTo: '',
          description: '',
          repeat: false,
          priority: '',
          // Add more properties for each event as needed
        });
      })
      .catch((error) => {
        console.error('Error saving event data:', error);
        // Show error message
        swal.fire({
          title: 'Error',
          text: 'Failed to save event data.',
          icon: 'error',
          confirmButtonText: 'OK',
        });
      });
  };

  return (
    <Router>
      <div>
        <h1>New Events</h1>
        {/* Input fields for each event property */}
        <form onSubmit={handleSubmit}>
          <label>
            Label:
            <input
              type="text"
              name="label"
              value={eventData.label}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Start Date:
            <input
              type="date"
              name="dateFrom"
              value={eventData.dateFrom}
              onChange={handleInputChange}
            />
          </label>
          <label>
            End Date:
            <input
              type="date"
              name="dateTo"
              value={eventData.dateTo}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Description:
            <textarea
              name="description"
              value={eventData.description}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Repeat:
            <input
              type="checkbox"
              name="repeat"
              checked={eventData.repeat}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Priority:
            <select
              name="priority"
              value={eventData.priority}
              onChange={handleInputChange}
            >
              <option value="">Select Priority</option>
              <option value="low">Low</option>
              <option value="medium">Medium</option>
              <option value="high">High</option>
            </select>
          </label>
          {/* Add more input fields for other event properties as needed */}
          <button type="submit">Submit</button>
        </form>

        {/* Link to go back to the home page */}
        <Link to="/">Go Back</Link>

        {/* Define the route for this page */}
        <Route path="/" component={NewEventsForm} />
      </div>
    </Router>
  );
};

export default NewEventsForm;
